import 'bootstrap/dist/css/bootstrap.css';
import logo from './logo.png';
import chat from './chat.png';
import user from './user.json';
import Header from './Header.js'

import React from 'react';
import {
  HashRouter as Router,
  Route,
  Link,
  NavLink
} from 'react-router-dom';

class Sidebar extends React.Component {
  render() {
    return (
      <div className="col-sm-3">
      <div id="sidebar">
        <br />
        <br />
        <a href="#" className="list-group-item">Personal Information</a>
        <a href="./survey" className="list-group-item">Self-survey Form</a>
        <a href="./analysis" className="list-group-item">Profile Analysis</a>
        <a href="./matching" className="list-group-item">Mentor Matching</a>
      </div>
    </div>
    );
  }
}

class Body extends React.Component {
  render() {
    return (
      <div className="col-sm-9" id="profileInfo">
        <div className="row" id="profileImg">
          <div className="col"><p>some text</p></div>
          <div className="col"><p>some text</p></div>
        </div>
        <div className="row" id="profileDetails">
          <div className="col-3 text-right"><p>Name*: </p></div>
          <div className="col-3 text-left">{user.name}</div>
        </div>
        <div className="row" id="profileDetails">
          <div className="col-3 text-right"><p>University*: </p></div>
          <div className="col-3 text-left">{user.name}</div>
        </div>
        <div className="row" id="profileDetails">
          <div className="col-3 text-right"><p>Year of Study*: </p></div>
          <div className="col-3 text-left">{user.studyYear}</div>
        </div>
        <div className="row" id="profileDetails">
          <div className="col-3 text-right"><p>Program*: </p></div>
          <div className="col-3 text-left">{user.program}</div>
        </div>
        <div className="row" id="profileDetails">
          <div className="col-3 text-right"><p>Location: </p></div>
          <div className="col-3 text-left">{user.location}</div>
        </div>
        <div className="row" id="profileDetails">
          <div className="col-3 text-right"><p>Area of Interest: </p></div>
          <div className="col-3 text-left">{user.name}</div>
        </div>
        <div className="row" id="profileDetails">
          <div className="col-3 text-right"><p>CGPA: </p></div>
          <div className="col-3 text-left">{user.gpa}</div>
        </div>
      </div>
    );
  }
}

class Profile extends React.Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <Header />
        </div>
        <div className="row" id="profileBody">
          <Sidebar />
          <Body />
        </div>
      </div>
    );
  }
}

export default Profile;
